$(document).ready(function() {
  // @qluqua FIX <iframe>-футера ДИТа, что бы он не ломал слайды на главной
  var $homeSlider = $('.sections_fs');
  var $footer = $('#footer');
  var $ditFooter = undefined;
  var $ditFooterWrap = $footer.find('.footer__common');

  // 2. Позиционируем ДИТфутер правильно
  function placeFooter() {
    $ditFooter.appendTo($ditFooterWrap);

    // 3. Если экран мелкий, разбиваем футеры на слайды, иначе не влезет контент
    if (window.innerWidth <= 700 || window.outerHeight <= 700) {
      $footer.addClass('alone');
      $ditFooterWrap.addClass('sections__item alone');
      $ditFooterWrap.insertBefore($footer);
      $homeSlider.slick('slickAdd', $ditFooterWrap);
    }
  };

  // 1. "Ловим" ДИТфутер на главной
  if ($('body').hasClass('home')) {
    var timerTick = null;
    var timerInner = function() {
      if ($('.footer-frame-wrp').length) {
        $ditFooter = $('.footer-frame-wrp');
        placeFooter();
        clearTimeout(timerTick);
      } else {
        timerTick = setTimeout(timerInner, 100);
      }
    }
    timerTick = setTimeout(timerInner, 500);
  };
});
